import React from "react";
import { Col, Row} from "reactstrap";

class Cards extends React.Component{
    render()
    {
        return(
            <Col lg="12" md="12" sm="12" xs="12">
                <div className="card-box card-wrap" >
                    <Row className="inner-layer">
                        <Col lg="3" md="3" sm="3" xs="3" style={{minHeight:"inherit"}}>
                            <div className="fileimage">
                                <i class="fa fa-file" aria-hidden="true"></i>
                            </div>
                        </Col>
                        <Col lg="9" md="9" sm="9" xs="9">
                            <p>{this.props.recent[this.props.ind].name}</p>
                            <div className="foot" style={{color:"gray"}}>
                                <span id="status"><i className="fas fa-circle"style={{fontSize:"9px",paddingRight:"7px"}}></i></span>
                                <span style={{lineHeight:"-6",fontSize:"16px"}}>{this.props.recent[this.props.ind].mode}</span>
                                <span style={{lineHeight:"-6",fontWeight:"300",padding:"5px",fontSize:"16px",paddingLeft:"8%"}}>{this.props.recent[this.props.ind].status}</span>
                            </div>
                        </Col>
                    </Row>
                </div>
            </Col>
        );
    }
}

export default Cards;
